import Head from 'next/head';

function Layout({ children }) {
  return (
    <>
      <Head>
        <title>database of read books - BookCase</title>
        <meta
          name="viewport"
          content="initial-scale=1.0, width=device-width"
          key="viewport"
        />
        <meta charset="utf-8"></meta>
      </Head>
      <div>TEST</div>
      {children}
    </>
  );
}

export default Layout;
